impl fmt::Display for Iform {
    fn fmt(&self, f: &mut fmt::Formatter<'_>) -> fmt::Result {
        f.write_str(unsafe {
            CStr::from_ptr(ffi::xed_iform_enum_t2str(self.0))
                .to_str()
                .unwrap()
        })
    }
}

impl FromStr for Iform {
    type Err = NulError;

    fn from_str(s: &str) -> Result<Self, Self::Err> {
        let s = CString::new(s)?;

        Ok(Iform(unsafe { ffi::str2xed_iform_enum_t(s.as_ptr()) }))
    }
}
